import { useEffect } from 'react';
import './App.css';
import { useLocalState } from './util/useLocalStorage';



function App() {
  const [jwt,setJwt] = useLocalState("","jwt");



  useEffect(() => {
    console.log("Hello World");
    console.log("jwt is " +jwt);
  const reqBody= {
    "username": "mulac",
    "password": "secretpassword",
  };




  fetch("http://localhost:8080/api/v1/auth/authenticate", {
    "headers": {
     "Content-Type": "application/json",
    },
    "method": "POST",
    body: JSON.stringify(reqBody),
    })
    .then(response => response.json())
    .then(data => {

      setJwt(data.token);
    });
    }, [jwt]);




  return (

    <div className="container-fluid">
      {/* Row 1 */}
      <div className="row row-highlight">
        <div className="col">
          {/* Your logo goes here */}
          <img src="path/to/your/logo.png" alt="Logo" className="logo" />
        </div>
        <div className="col-5"></div>
        <div className="col-3 col-text">
          <h3>Jwt is {jwt}</h3>
        </div>
        <div className="col"></div>
      </div>

      {/* Row 2 */}
      <div className="row row-background">
        <div className="col-3 col-text">
          <h3>Thank you for choosing us</h3>
        </div>
        <div className="col-5"></div>
        <div className="col-3"></div>
      </div>

      {/* Row 3-5 */}
      <div className="row row-background">
        <div className="col-3 col-text">
          {/* Description of your app */}
          <p>Description of our app goes here.</p>
        </div>
        <div className="col-5"></div>
        <div className="col-3"></div>
      </div>

      {/* Row 6 */}
      <div className="row row-background">
        <div className="col-2"></div>
        <div className="col-3">
          {/* Register button */}
          <button className="btn btn-primary btn-register">Register</button>
        </div>
        <div className="col-2"></div>
      </div>

      {/* Row 7 */}
      <div className="row row-highlight">
        <div className="col"></div>
        <div className="col-5"></div>
        <div className="col-3">
          {/* Login button */}
          <button className="btn btn-primary btn-login">Login</button>
        </div>
        <div className="col"></div>
      </div>
    </div>
  );
};


export default App;
